                </div>
                <div class="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
                    <ul class="new navbar-nav navbar-right">
                    <li class="active"><a hreg="#">home</a></li>
                        <li class="active"><a href="#">Story</a></li>
